  [],\n\t\"revision_timestamp\": \"2015-06-19T15:41:32.162759\",\n\t\"name\": \"digital-flood-insurance-rate-map-database-lenoir-county-north-carolina\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Flood Insurance Study was produced
  through a cooperative partnership between the State of North Carolina and FEMA.
  The North Carolina Floodplain Mapping Program, through FEMA's Cooperating Technical
  State (CTS) Initiative, is conducting flood hazard analyses and producing updated,
  digital FIRM panels for all North Carolina communities. Additional information regarding
  the North Carolina Floodplain Mapping Program and the data collected during the
  mapping process are available at http://www.ncfloodmaps.com. The Digital Flood Insurance
  Rate Map (DFIRM) Database depicts flood risk information and supporting data used
  to develop the risk data. The primary risk classifications used are the 1-percent-annual-chance
  flood event, the 0.2-percent-annual-chance flood event, and areas of minimal flood
  risk. The DFIRM Database is derived from Flood Insurance Studies (FISs), previously
  published Flood Insurance Rate Maps (FIRMs), flood hazard analyses performed in
  support of the FISs and FIRMs, and new mapping data, where available. The FISs and
  FIRMs are published by the Federal Emergency Management Agency (FEMA). The file
  is georeferenced to the earth's surface using the NC State Plane Coordinate System,
  North American Datum 1983, Units of Feet. The specifications for the horizontal
  control of DFIRM data files are consistent with those required for mapping at a
  scale of 1:12,000.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
